import React, { useEffect } from "react";
import { Container, Row, Col } from "reactstrap";
import { useParams } from "react-router-dom";
import carData from "../assets/data/carData";
import Helmet from "../components/Helmet/Helmet";
import BookingForm from "../components/UI/BookingForm";
import PaymentMethod from "../components/UI/PaymentMethod";
import "../styles/car-details.css";

const CarDetails = () => {
  const { slug } = useParams();
  const singleCarItem = carData.find((item) => item.carName === slug);

  useEffect(() => {
    window.scrollTo(0, 0);
  }, [singleCarItem]);

  if (!singleCarItem) {
    return <div className="text-center py-5">Автомобиль не найден</div>;
  }

  // Функция для отображения рейтинга звездами
  const renderRatingStars = (rating) => {
    const stars = [];
    for (let i = 1; i <= 5; i++) {
      stars.push(
        <i 
          key={i}
          className={`ri-star-${i <= rating ? 's' : ''}fill`}
          style={{ color: "#f9a826" }}
        ></i>
      );
    }
    return stars;
  };

  return (
    <Helmet title={singleCarItem.carName}>
      <section className="car-details">
        <Container>
          <Row className="align-items-start">
            {/* Галерея автомобиля */}
            <Col lg="6" className="mb-4 mb-lg-0">
              <div className="car-gallery">
                <img 
                  src={singleCarItem.imgUrl} 
                  alt={singleCarItem.carName}
                  className="main-image w-100 rounded-3 shadow"
                />
                {/* Здесь можно добавить миниатюры для галереи */}
              </div>
            </Col>

            {/* Информация об автомобиле */}
            <Col lg="6">
              <div className="car-info p-4 rounded-3 shadow-sm">
                <h1 className="car-title mb-3">{singleCarItem.carName}</h1>

                <div className="d-flex align-items-center justify-content-between mb-4">
                  <div className="car-price">
                    <span className="fw-bold fs-3 text-primary">
                      ${singleCarItem.price}.00
                    </span>
                    <span className="text-muted"> / сутки</span>
                  </div>

                  <div className="car-rating d-flex align-items-center">
                    <div className="stars me-2">
                      {renderRatingStars(singleCarItem.rating)}
                    </div>
                    <span>({singleCarItem.rating} оценок)</span>
                  </div>
                </div>

                <p className="car-description lead">
                  {singleCarItem.description}
                </p>

                <div className="car-features">
                  <div className="features-row d-flex justify-content-between mb-3">
                    <div className="feature-item">
                      <i className="ri-roadster-line feature-icon"></i>
                      <span>{singleCarItem.model}</span>
                    </div>
                    <div className="feature-item">
                      <i className="ri-settings-2-line feature-icon"></i>
                      <span>{singleCarItem.automatic ? 'Автомат' : 'Механика'}</span>
                    </div>
                    <div className="feature-item">
                      <i className="ri-timer-flash-line feature-icon"></i>
                      <span>{singleCarItem.speed}</span>
                    </div>
                  </div>

                  <div className="features-row d-flex justify-content-between">
                    <div className="feature-item">
                      <i className="ri-map-pin-line feature-icon"></i>
                      <span>{singleCarItem.gps ? 'GPS навигация' : 'Без GPS'}</span>
                    </div>
                    <div className="feature-item">
                      <i className="ri-wheelchair-line feature-icon"></i>
                      <span>{singleCarItem.seatType}</span>
                    </div>
                    <div className="feature-item">
                      <i className="ri-building-2-line feature-icon"></i>
                      <span>{singleCarItem.brand}</span>
                    </div>
                  </div>
                </div>
              </div>
            </Col>

            {/* Форма бронирования */}
            <Col lg="7" className="mt-5">
              <div className="booking-card card p-4 shadow-sm">
                <h2 className="card-title mb-4">Форма бронирования</h2>
                <BookingForm />
              </div>
            </Col>

            {/* Информация об оплате */}
            <Col lg="5" className="mt-5">
              <div className="payment-card card p-4 shadow-sm">
                <h2 className="card-title mb-4">Способы оплаты</h2>
                <PaymentMethod />
              </div>
            </Col>
          </Row>
        </Container>
      </section>
    </Helmet>
  );
};

export default CarDetails;
